import React from 'react';

const TableRow = (props) => {
  const formatter = new Intl.NumberFormat('en-US', {
    style: 'currency',
    currency: 'USD',
    minimumFractionDigits: 2,
    maximumFractionDigits: 2,
  })

  return (
    <tr>
      <td>{props.item.year}</td>
      <td>{props.item.savingsEndOfYear}</td>
      <td>{props.item.yearlyInterest}</td>
      <td>
        {props.item.savingsEndOfYear -
          props.initialInvestment -
          props.item.yearlyContribution * props.item.year}
      </td>
      <td>{props.initialInvestment + props.item.yearlyContribution * props.item.year}</td>
    </tr>
  );
};

export default TableRow;
